import { baseic } from "./ApiClient";

export const basicAuthentication = (token)=> baseic.get('basicauth',{
    headers:{
        Authorization:token
    }
})

export const basicJWTAuthentication
= (username,password)=>
 baseic.post('authenticate',{username,password})
